import React from 'react';
import s from './header.module.css'
import img from './../../assets/logo.png'

const Header = () => {
    const menuItems = ['Home', 'Services', 'Shop', 'About us', 'Variants', 'My Account']
    return (
        <div className={s.menuContainer}>
            <div className={s.logo} id={'Home'}>
                <img src={img} alt={'logo'}/>
            </div>
            <nav>
                <div className={s.burger}>&#9776; MENU</div>
                <div className={s.menu}> {menuItems.map((item, index) => <a key={index} href={`#${item}`}>{item}</a>)}</div>
            </nav>
        </div>
    );
};

export default Header;
